INSERT INTO PUBLIC.BOOK (ID, CONTENT, DESCRIPTION, IMAGE_URL, NAME, PUBLISH_YEAR, RATING, GENRE_ID) VALUES (6, '', 'It is a 1986 horror novel by American author Stephen King. It was his 22nd book, and his 18th novel written under his own name. The story follows the experiences of seven children as they are terrorized by an entity that exploits the fears and phobias of its victims to disguise itself while hunting its prey. "It" primarily appears in the form of a clown to attract its preferred prey of young children.
INSERT INTO PUBLIC.BOOK (ID, CONTENT, DESCRIPTION, IMAGE_URL, NAME, PUBLISH_YEAR, RATING, GENRE_ID) VALUES (9, '', 'The Shining is a horror novel by American author Stephen King. Published in 1977, it is King''s third published novel and first hardback bestseller: the success of the book firmly established King as a preeminent author in the horror genre. The setting and characters are influenced by King''s personal experiences, including both his visit to The Stanley Hotel in 1974 and his recovery from alcoholism. The novel was followed by a sequel, Doctor Sleep, published in 2013.
